import React from 'react';
import Mailchimp from 'react-mailchimp-form';

class Dogs extends Component {
    render() {
      return (
          <Mailchimp
          action='https://<YOUR-USER>.us16.list-manage.com/subscribe/post?u=XXXXXXXXXXXXX&amp;id=XXXXXX'
          fields={[
            {
              name: 'EMAIL',
              placeholder: 'Email',
              type: 'email',
              required: true
            }
          ]}
          />
      );
    }
  }

const dogs = 
<form action="https://rocks.us15.list-manage.com/subscribe/post?u=645c4a5124c0e6aae7ac2b2f6&amp;id=f78bc0d515" method="post" id="mc-embedded-subscribe-form" name="mc-embedded-subscribe-form" class="validate" target="_blank" novalidate>
    <div id="mc_embed_signup_scroll">

<div>
	<label for="mce-EMAIL">Email </label>
	<input type="email" value="" name="EMAIL" class="required email" id="mce-EMAIL"/>
</div>
<div >
	<label for="mce-FNAME">Name </label>
	<input type="text" value="" name="FNAME" class="required" id="mce-FNAME"/>
</div>
	<div id="mce-responses" class="clear">
		<div  id="mce-error-response" style="display:none"></div>
		<div  id="mce-success-response" style="display:none"></div>
	</div> 
    <div style="position: absolute; left: -5000px;" aria-hidden="true"><input type="text" name="b_645c4a5124c0e6aae7ac2b2f6_f78bc0d515" tabindex="-1" value=""/></div>
    <div ><input type="submit" value="Subscribe" name="subscribe" id="mc-embedded-subscribe" class="button"/></div>
    </div>
</form>;

export default Dogs;
